INSERT INTO `request` VALUES (5,6,55,20,82,'1','he finally resubmitted a readable file for his PT',1,'01/05/2021','Accepted','2021-01-03 08:36:09'),(6,6,218,20,110,'1','to encode grades',1,'','Declined','2021-01-03 12:03:48'),(9,6,24,7,86,'1','Change of grade from 81 to 90.\r\nThe reason for the change of grade is that this should have been left as a blank grade. There is one missing major output due to an expired meeting link recording submitted. It expired because it took me more than 30 days to check this performance task. I apologize for the confusion.',1,'2021-01-06 14:52:22','Accepted','2021-01-06 14:52:22'),(10,6,193,33,96,'1','Student\'s name didn\'t appear on group outputs, and delay in submission of declamation video (major activity).',1,'2021-01-09 02:57 PM','Accepted',NULL),(11,6,133,18,152,'1','Student did not submit during the deadline. He just submitted yesterday and I gave him scores.',1,'2021-01-09 02:57 PM','Accepted',NULL),(12,6,111,33,150,'1','Student\'s grade has to be recomputed. Student missed to take a quiz, but was able to provide a valid reason for her absence.',1,'2021-01-09 02:57 PM','Accepted',NULL),(16,6,95,22,124,'1','delayed submission of lacking course requirement ',1,'2021-02-22 03:00 PM','Accepted',NULL),(17,6,52,7,86,'1','Requesting to edit First Grading from \"No Grade\" to \"70.\" After all the efforts to ensure student compliance, no progress has been made from the student. She is given a Midterm Grade of 70, and a Final Grade of 77. Thank you.',1,'2021-02-22 03:00 PM','Accepted',NULL),(18,6,143,7,70,'1','Requesting to change the First Grading from \"NO GRADE\" to \"85.\" The student has complied with all the necessary requirements for the completion of this subject. She is now given a Midterm Grade of 85, and a Final Grade of 88. Thank you.',1,'2021-02-22 03:00 PM','Accepted',NULL),(19,6,132,18,152,'2','Student submitted lacking requirement around 11:30PM, Feb 19. She just sent without informing me. \r\n\r\n',1,'2021-02-22 03:00 PM','Accepted',NULL),(20,6,52,25,85,'2','She just recently complied (20 Feb 2021) with her missing requirements (Infographic and Write Up) which constitutes a major portion of their class standing in the subject.',1,'2021-02-22 05:00 PM','Accepted',NULL),(21,6,167,25,68,'2','He just recently complied (22 Feb 2021) with all the tasks for this subject. \r\n\r\nThis was after a series of follow-ups and contacts, with the help of the adviser. He does not respond to the follow-ups, but if he does, he just says he will do it (without any apparent attempts at that time).\r\n\r\nOn the night of the deadline of grades, I opted to mark him as failed, but surprisingly, he then complied with his works 2 days after. Hence, this request. \r\n\r\nThank you miss Cath.',1,'2021-02-22 05:00 PM','Accepted',NULL),(22,6,171,25,68,'2','She just submitted recently (21 Feb 2021) her final exam for this subject. When asked why, this was due to health reasons (COVID-19). Hence, I allowed her to comply beyond the deadline and would like to request an edit.\r\n\r\nThank you miss.',1,'2021-02-22 05:00 PM','Accepted',NULL),(23,6,164,25,68,'2','She just recently submitted (21 Feb 2021) her final exam. \r\n\r\nShe was already reminded before of her missing requirements, in which she said yes, but failed to submit the exam before the deadline. \r\n\r\nThank you miss.',1,'2021-02-22 05:00 PM','Accepted',NULL),(24,6,143,25,68,'1','I gave her \"No Grade\" for the 1st GP because she has not complied with the requirements. However, she promised to comply with those by the end of the semester.\r\n\r\nShe was able to comply with them before the end of the semester. I wasn\'t able to edit her 1st GP grade on the deadline of grades (19 Feb 2021) because there was no option to edit it at that time.\r\n\r\nThank you miss.',1,'2021-02-22 05:00 PM','Accepted',NULL),(25,6,78,22,124,'2','missing course requirement ',1,'2021-02-23 03:00 PM','Accepted',NULL),(26,6,116,23,146,'2','changes were not included upon transferring SAPIS to UP Cebu domain',1,'2021-02-23 03:00 PM','Accepted',NULL),(27,6,132,23,146,'2','changed grades were not included upon transferring to UP Cebu domain',1,'2021-02-23 03:00 PM','Accepted',NULL),(28,6,133,23,146,'2','same reason',1,'2021-02-23 03:00 PM','Accepted',NULL);
